Supporting quotes for "Supplementary mat:
  - "The organization of this paper is as follows. The second chapter provides the methodology employed in this paper to identify and analyse literature related to heat waves. This is followed by a review of various definitions of heat waves. The fourth chapter reveals impacts of heat waves on human health and ecosystems. The fifth chapter reviews the mechanisms available to deal with these impacts. The sixth chapter identifies the implications of the extensive review conducted in this study, particularly for the building design of dwellings. Finally, the conclusions are drawn together with the identification of future research directions."
  - "This paper reports on a critical literature review which covers the following main aspects: (1) the definition of heat waves; (2) the impacts of heat waves on health, ecosystems and the built environment;

(3) the current mechanisms to deal with impacts of heat waves."
